"get parameters of pulse from bruker file\n
output: ampl, phase, ptgrid"
function wave_parameters(filename, rfmax, tpulse)

    ampl,phase = read_bruker_wave(filename)
    ampl = ampl*rfmax/100.0
    ptgrid = collect(tpulse/size(ampl)[1]:tpulse/size(ampl)[1]:tpulse)

    return ampl, phase, ptgrid
end


"pulse is repeated until it is longer than the acquisition time\n
output: acqux, acquy, acquz, acqut"
function repeat_pulse(acqux, acquy, acquz, acqut, npoints, dwell)
    pulse_duration = sum(acqut)

    if pulse_duration < dwell*npoints      # if pulse is shorter than dwell time
        factor = ceil(Int, dwell*npoints / pulse_duration)
        acqux = repeat(acqux, factor)
        acquy = repeat(acquy, factor)
        acquz = repeat(acquz, factor)
        acqut = repeat(acqut, factor)
    end
    return acqux, acquy, acquz, acqut
end


"pulse is repeated until it is longer than the acquisition time \n
bilevel of adiabatic pulse is included\n
output: acqux, acquy, acquz, acqut"
function repeat_pulse_adiabatic_bilevel(acqux, acquy, acquz, acqut, acqux_bilevel, acquy_bilevel, acquz_bilevel, acqut_bilevel, npoints, dwell)       # TODO still old version before xyzgt
    # repeat pulse until pulse is longer than acqusition time
    bilevel_duration = 0
    ptgrid = []

    if isempty(acqut_bilevel) == false
        append!(ptgrid, acqut_bilevel[1])
        for dig in 2:size(acqut_bilevel)[1]
            append!(ptgrid, ptgrid[dig-1] + acqut_bilevel[dig])
        end
        bilevel_duration = sum(acqut_bilevel)
    end

    fptgrid = ptgrid
    pulse_duration = sum(acqut)      # duration of one normal pulse (not bilevel)

    if bilevel_duration < dwell*npoints      # if bilevel part of pulse is shorter than dwell time
        factor = ceil(Int, (dwell*npoints-bilevel_duration) / pulse_duration)     
        dig = length(ptgrid)
        for rep = 1:factor+1        # repeat pulse until it's longer than total acqusition time
            for pt = 1:length(acqux)
                if isempty(fptgrid)
                    append!(fptgrid, acqut[pt])
                else
                    append!(fptgrid, fptgrid[dig]+acqut[pt])
                end
                dig += 1
            end
        end
        acqux = repeat(acqux, factor+1)
        acquy = repeat(acquy, factor+1)
        acquz = repeat(acquz, factor+1)
    end
    facqux = vcat(acqux_bilevel, acqux)
    facquy = vcat(acquy_bilevel, acquy)
    facquz = vcat(acquz_bilevel, acquz)

    facqut = [fptgrid[1]]
    for dig in 2:size(fptgrid)[1]
        append!(facqut, fptgrid[dig]-fptgrid[dig-1])
    end

    return facqux, facquy, facquz, facqut
end


"pulses are split up between each dwell times, so the FID can be caluclated at each dwell time\n
output:  acqux, acquy, acquz, acqut, digdwell"
function correct_xyz_to_dwell(acqux, acquy, acquz, acqut, npoints, dwell)

    ptgrid = get_ptgrid(acqut)
    digdwell=zeros(npoints)     # contains amount of pulse digits per dwell time, pulses in between are seperated into two similar pulses
    facqux = Float64[]          
    facquy = Float64[]          
    facquz = Float64[]          
    facqut = Float64[]             # final time of each pulses used for simulation
    pulse_finished = false
    pcounter = 1                # counting the pulses
    ctime = 0.0
    dtgrid = ones(npoints) .* collect(1:npoints) .* dwell

    # generate digdwell and corrected acqux and acquy
    # facqux, acquy and facqut contain the same pulse parameters, but cut into two at each dwell time
 
    for ipoints=1:npoints
        if pulse_finished == false
            digdwell[ipoints] += 1
            while pcounter < size(ptgrid)[1] && ptgrid[pcounter] < dtgrid[ipoints]       # if pulse ends before the time step is ending
                append!(facqux, acqux[pcounter])
                append!(facquy, acquy[pcounter])
                append!(facquz, acquz[pcounter])
                append!(facqut, ptgrid[pcounter]-ctime)
                ctime = ptgrid[pcounter]
                digdwell[ipoints] += 1
                pcounter += 1
            end
            
            append!(facqux, acqux[pcounter])      # rest of pulse which ends in next time step
            append!(facquy, acquy[pcounter])
            append!(facquz, acquz[pcounter])
            if pcounter == size(acqux)[1]
                append!(facqut, minimum([ptgrid[pcounter]-ctime, dwell, dtgrid[ipoints]-ctime]))
            else
                append!(facqut, dtgrid[ipoints]-ctime)
            end

            ctime = dtgrid[ipoints]
            if ptgrid[pcounter] == dtgrid[ipoints] && pcounter < size(ptgrid)[1]     # if pulse ends at the end of the time step
                pcounter += 1
            end
            if pcounter == size(acqux)[1] && ctime >= ptgrid[pcounter]
                pulse_finished = true
            end
        end
    end

    return facqux, facquy, facquz, facqut, digdwell
end


"get parameters of final pulse, which is repeated until the end of the fid, and which is cut into two pieces at each dwell time\n
output: acqux, acquy, acquz, acqut, digdwell"
function get_final_pulse_acq_bilevel(nbilevel::Int64, nspins, ux, uy, uz, ut, npoints, dwell)

    uxtemp, uytemp, uztemp, uttemp = Vector{Vector{Vector{Float64}}}(), Vector{Vector{Vector{Float64}}}(), Vector{Vector{Vector{Float64}}}(), Vector{Vector{Vector{Float64}}}()
    fux, fuy, fuz, fut = Vector{Vector{Vector{Float64}}}(), Vector{Vector{Vector{Float64}}}(), Vector{Vector{Vector{Float64}}}(), Vector{Vector{Vector{Float64}}}()
    digdwell = Vector{Vector{Float64}}()

    for ispin = 1:nspins
        push!(uxtemp, [[]]), push!(uytemp, [[]]), push!(uztemp, [[]]), push!(uttemp, [[]])
    end
    for ilevel = 1:nbilevel
        push!(digdwell, [])
    end

    for ispin = 1:nspins
        if isempty(ux[ispin])
            for ilevel = 1:nbilevel
                if ilevel == 1
                    uxtemp[ispin] = [[0]]; uytemp[ispin] = [[0]]; uztemp[ispin] = [[0]]; uttemp[ispin] = [[npoints*dwell]]
                else
                    push!(uxtemp[ispin], [0])
                    push!(uytemp[ispin], [0])
                    push!(uztemp[ispin], [0])
                    push!(uttemp[ispin], [npoints*dwell])
                end
            end
        else
            uxrep, uyrep, uzrep, utrep = Vector{Vector{Float64}}(), Vector{Vector{Float64}}(), Vector{Vector{Float64}}(), Vector{Vector{Float64}}()
            for ilevel = 1:size(ux[ispin])[1]
                uxreptemp, uyreptemp, uzreptemp, utreptemp = Float64[], Float64[], Float64[], Float64[]
                if isempty(ux[ispin][ilevel]) #|| sum(ux[ispin][ilevel]) >= npoints*dwell
                    uxreptemp, uyreptemp, uzreptemp, utreptemp = [0], [0], [0], [npoints*dwell]
                else
                    uxreptemp, uyreptemp, uzreptemp, utreptemp = repeat_pulse(ux[ispin][ilevel], uy[ispin][ilevel], uz[ispin][ilevel], ut[ispin][ilevel], npoints, dwell)
                end
                push!(uxrep, uxreptemp), push!(uyrep, uyreptemp), push!(uzrep, uzreptemp), push!(utrep, utreptemp)
            end
            factor = ceil(Int32, nbilevel/size(ux[ispin])[1])
            uxtemp[ispin] = uxrep; uytemp[ispin] = uyrep; uztemp[ispin] = uzrep; uttemp[ispin] = utrep
            for ifac = 1:factor-1
                push!(uxtemp[ispin], uxrep[1]); push!(uytemp[ispin], uyrep[1]); push!(uztemp[ispin], uzrep[1]); push!(uttemp[ispin], utrep[1])
            end
        end
    end
    
    uxtemp, uytemp, uztemp, uttemp = correct_timing_two_pulses_bilevel(uxtemp, uytemp, uztemp, uttemp)

    for ispin = 1:nspins
        uxdwell, uydwell, uzdwell, utdwell, digdwelltemp = correct_xyz_to_dwell(uxtemp[ispin][1], uytemp[ispin][1], uztemp[ispin][1], uttemp[ispin][1], npoints, dwell)
        push!(fux, [uxdwell]); push!(fuy, [uydwell]); push!(fuz, [uzdwell]); push!(fut, [utdwell])
        digdwell[1] = digdwelltemp
        for ilevel = 2:nbilevel
            uxdwell, uydwell, uzdwell, utdwell, digdwelltemp = correct_xyz_to_dwell(uxtemp[ispin][ilevel], uytemp[ispin][ilevel], uztemp[ispin][ilevel], uttemp[ispin][ilevel], npoints, dwell)
            push!(fux[ispin], uxdwell)
            push!(fuy[ispin], uydwell)
            push!(fuz[ispin], uzdwell)
            push!(fut[ispin], utdwell)
            digdwell[Int(ilevel)] = digdwelltemp
        end
    end
    
    return fux, fuy, fuz, fut, digdwell
end


"get parameters of final pulse, which is repeated until the end of the fid, and which is cut into two pieces at each dwell time\n
output: acqux, acquy, acquz, acqut, digdwell"
function get_final_pulse_acq(ux, uy, uz, ut, npoints, dwell)

    uxtemp, uytemp, uztemp, uttemp = Vector{Vector{Float64}}(), Vector{Vector{Float64}}(), Vector{Vector{Float64}}(), Vector{Vector{Float64}}()
    fux, fuy, fuz, fut = Vector{Vector{Float64}}(), Vector{Vector{Float64}}(), Vector{Vector{Float64}}(), Vector{Vector{Float64}}()
    digdwell = []

    for ispin = 1:size(ux)[1]
        if ux[ispin] == []
            push!(uxtemp, [0])
            push!(uytemp, [0])
            push!(uztemp, [0])
            push!(uttemp, [npoints*dwell])
        else
            uxrep, uyrep, uzrep, utrep = repeat_pulse(ux[ispin], uy[ispin], uz[ispin], ut[ispin], npoints, dwell)
            push!(uxtemp, uxrep)
            push!(uytemp, uyrep)
            push!(uztemp, uzrep)
            push!(uttemp, utrep)
        end
    end

    uxtemp, uytemp, uztemp, uttemp = correct_timing_two_pulses(uxtemp, uytemp, uztemp, uttemp)

    for ispin in eachindex(ux)
        uxdwell, uydwell, uzdwell, utdwell, digdwell = correct_xyz_to_dwell(uxtemp[ispin,:], uytemp[ispin,:], uztemp[ispin,:], uttemp[ispin,:], npoints, dwell)
        push!(fux, uxdwell)
        push!(fuy, uydwell)
        push!(fuz, uzdwell)
        push!(fut, utdwell)
    end
    
    fux = reduce(hcat, fux)'
    fuy = reduce(hcat, fuy)'
    fuz = reduce(hcat, fuz)'
    fut = reduce(hcat, fut)'

    return fux, fuy, fuz, fut, digdwell
end


"get fid according to optimal tracking algorithm in paper \"Journal of Magnetic Resonance 201 (2009) 7–17\"\n
output: fid"
function get_fid_reduced_Liouville_space(rhoinit, digdwell, acqux, acquy, acquz, acqut, J, fB1, nB1, noffs, npoints, dwell, T2_time, offs)
    fid = zeros(ComplexF64, nB1, noffs, npoints)

    for iB1 = 1:nB1
        for ioffs = 1:noffs
            # simulating the FID
            rho = rhoinit
            ipulse = 1                                                  # digit of pulse

            for ipoints = 1:npoints

                # calculate fid at each acquisition point
                fid[iB1, ioffs, ipoints] = rho[4]*exp(-(ipoints-1)*dwell/T2_time)

                for idig = 1:digdwell[ipoints]                            # calculate rho for every digit between two acquisition points
                    uevotrack = get_uevo(offs[ioffs], fB1[iB1], acqux[2,ipulse], acquy[2,ipulse], acquz[2,ipulse], acqut[2,ipulse], J)
                    rho = uevotrack*rho 
                    ipulse += 1
                end
            end
        end
    end

    return fid
end


"function to calculate the propargator according to Journal of Magnetic Resonance 201 (2009) 7–17 \n
S_offs: offset of spin S in Hz \n
eps: epsilon for B1 inhomogeneity \n
output: Uevo (evolutional propagator)"
function get_uevo(S_offs, eps, acqux, acquy, acquz, acqut, J)
    uevotrack = zeros(4,4)
    gamma = 1
    freq_p = sqrt((eps*acqux)^2+(eps*acquy)^2+(S_offs-acquz+J/2)^2)
    freq_m = sqrt((eps*acqux)^2+(eps*acquy)^2+(S_offs-acquz-J/2)^2)
    sin_p, cos_p = sincos(pi*freq_p*acqut)
    sin_m, cos_m = sincos(pi*freq_m*acqut)
    ap = -eps*acqux/freq_p*sin_p                           # a_plus
    am = -eps*acqux/freq_m*sin_m                           # a_minus, etc.
    bp = -eps*acquy/freq_p*sin_p
    bm = -eps*acquy/freq_m*sin_m
    cp = -(S_offs-acquz+J/2)/freq_p*sin_p
    cm = -(S_offs-acquz-J/2)/freq_m*sin_m
    dp = cos_p
    dm = cos_m
    uevotrack[1,1] =  ap*am-bp*bm-cp*cm+dp*dm
    uevotrack[1,2] =  ap*bm+bp*am+cp*dm+dp*cm
    uevotrack[1,3] =  ap*cm-bp*dm+cp*am-dp*bm
    uevotrack[1,4] = -ap*dm-bp*cm+cp*bm+dp*am
    uevotrack[2,1] =  ap*bm+bp*am-cp*dm-dp*cm
    uevotrack[2,2] = -ap*am+bp*bm-cp*cm+dp*dm
    uevotrack[2,3] =  ap*dm+bp*cm+cp*bm+dp*am
    uevotrack[2,4] =  ap*cm-bp*dm-cp*am+dp*bm
    uevotrack[3,1] =  ap*cm+bp*dm+cp*am+dp*bm
    uevotrack[3,2] = -ap*dm+bp*cm+cp*bm-dp*am
    uevotrack[3,3] = -ap*am-bp*bm+cp*cm+dp*dm
    uevotrack[3,4] = -ap*bm+bp*am-cp*dm+dp*cm
    uevotrack[4,1] =  ap*dm-bp*cm+cp*bm-dp*am
    uevotrack[4,2] =  ap*cm+bp*dm-cp*am-dp*bm
    uevotrack[4,3] = -ap*bm+bp*am+cp*dm-dp*cm
    uevotrack[4,4] =  ap*am+bp*bm+cp*cm+dp*dm
    return uevotrack
end


"get fid calculated in spin operator formalism\n
output: fid"
function get_fid_Liouville_space(cstrength, rhoinit, digdwell, acqux, acquy, acquz, acqut, J, fB1, nB1, noffs, npoints, dwell, T2_time, offs, fidspin, pulsespins, offsetspins)

    fid = zeros(ComplexF64, nB1, noffs, npoints)
    ampl, phase = zeros(size(acqux)), zeros(size(acqux))
    for ispin = 1:size(acqux)[1]
        ampl[ispin,:], phase[ispin,:] = xy_to_ampl_phase(acqux[ispin,:], acquy[ispin,:])
    end

    if cstrength == "weak"
        hj12 = 2*pi*J*(iz[:,:,1]*iz[:,:,2])           # Kopplungsentwicklung zwischen Spin 1 und 2
    elseif cstrength == "strong"
        hj12 = 2*pi*J*(ix[:,:,1]*ix[:,:,2]+iy[:,:,1]*iy[:,:,2]+iz[:,:,1]*iz[:,:,2])
    else
        println("please enter \"strong\" or \"weak\" as coupling strength")
    end

    for iB1 = 1:nB1
        for ioffs=1:noffs
   
            # simulating the FID
            rho = rhoinit
            ipulse = 1                  # points of pulse
            
            hcs = zeros(size(iz[:,:,1]))
            for ispin in offsetspins
                hcs = hcs - 2*pi*offs[ioffs]*iz[:,:,ispin]
            end

            for ipoints = 1:npoints     # points of measurement
                
                # calculate fid at each acquisition point
                fid[iB1, ioffs, ipoints] = tr(rho*(im[:,:,fidspin]))*exp(-(ipoints-1)*dwell/T2_time)

                for idig = 1:digdwell[ipoints]        # calculate rho for every digit between two acquisition points
                    hpulse = zeros(size(iz[:,:,1]))
                    for ispin in pulsespins
                        phasesin, phasecos = sincosd(phase[ispin,ipulse])
                        hpulse = hpulse + 2*pi*fB1[iB1]*ampl[ispin,ipulse]*(phasecos*ix[:,:,ispin]+phasesin*iy[:,:,ispin])
                        hpulse = hpulse + 2*pi*acquz[ispin,ipulse]*iz[:,:,ispin]
                    end
                    uevo = exp(-i*(hj12+hcs+hpulse)*acqut[pulsespins[1],ipulse])
                    rho = uevo*rho*uevo'
                    ipulse += 1
                end
            end
        end
    end
    return fid
end


"starting with the pulse parameters of an adiabatic pulse, the spectra, fid and projection are simulated as BILEVEL\n
output: spectr, fid, projection, time"
function simulate_fid_heteroD_bilevel(cstrength, Liouville_space, acquxm, acquym, acquzm, acqutm, nbilevel, rhoinit, J, fB1, nB1, noffs, npoints, dwell, T2_time, nspins, offs, fidspin, pulsespins, offsetspins)

    fid = zeros(nB1, noffs, npoints)
    global test_single_fid = zeros(nbilevel, nB1, noffs, npoints)
    acquxm, acquym, acquzm, acqutm, digdwell = get_final_pulse_acq_bilevel(nbilevel, nspins, acquxm, acquym, acquzm, acqutm, npoints, dwell)

    for ifid = 1:size(acquxm[1])[1]
        println("starting simulation of FID ", ifid)
        global facquxm = [acquxm[1][ifid] acquxm[2][ifid]]'            # only for 2 spin system
        global facquym = [acquym[1][ifid] acquym[2][ifid]]'
        global facquzm = [acquzm[1][ifid] acquzm[2][ifid]]'
        global facqutm = [acqutm[1][ifid] acqutm[2][ifid]]'

        if Liouville_space == "reduced"
            single_fid =  get_fid_reduced_Liouville_space(rhoinit, digdwell[ifid], facquxm, facquym, facquzm, facqutm, J, fB1, nB1, noffs, npoints, dwell, T2_time, offs)
            if cstrength == "strong"
                println("only weak coupling impemented for reduced Liouville space. Weak coupling was used instead\nFID is automatically taken of spin 1, pulse and offset is on spin 2")
            end
        elseif Liouville_space == "not reduced"
            single_fid = get_fid_Liouville_space(cstrength, rhoinit, digdwell[ifid], facquxm, facquym, facquzm, facqutm, J, fB1, nB1, noffs, npoints, dwell, T2_time, offs, fidspin, pulsespins, offsetspins)
        else
            println("algorithm not implemented. Please choose \"reduced\" or \"not reduced\"")
            single_fid = fid
        end
        test_single_fid[ifid,:,:,:] = single_fid
        fid = single_fid/size(acquxm[1])[1] + fid
    end

    time = [i * dwell for i in 0:(npoints-1)]       # times at which acquisition was done
    spectr = fft_fid(fid, nB1, noffs, npoints)
    projection = get_projection(spectr, nB1, noffs)

    return spectr, fid, projection, time
end


"starting with the pulse parameters of an adiabatic pulse, the spectra, fid and projection are simulated\n
cstrength: coupling strength between the two spins (weak or strong)\n
Liouville space: can be \"reduced\" or \"not reduced\", according to Journal of Magnetic Resonance 201 (2009) 7–17 \n\n"
function simulate_fid_heteroD(cstrength, Liouville_space, acqux, acquy, acquz, acqut, rhoinit, J, fB1, nB1, noffs, npoints, dwell, T2_time, offs, fidspin, pulsespins, offsetspins)

    global facqux, facquy, facquz, facqut, acqdigdwell = get_final_pulse_acq(acqux, acquy, acquz, acqut, npoints, dwell)
 
    if Liouville_space == "reduced"
        fid = get_fid_reduced_Liouville_space(rhoinit, acqdigdwell, facqux, facquy, facquz, facqut, J, fB1, nB1, noffs, npoints, dwell, T2_time, offs)
        if cstrength == "strong"
            println("only weak coupling impemented for reduced Liouville space. Weak coupling was used instead\nFID is automatically taken of spin 1, pulse and offset is on spin 2")
        end
    elseif Liouville_space == "not reduced"
        fid = get_fid_Liouville_space(cstrength, rhoinit, acqdigdwell, facqux, facquy, facquz, facqut, J, fB1, nB1, noffs, npoints, dwell, T2_time, offs, fidspin, pulsespins, offsetspins)
    else
        println("algorithm not implemented. Please choose \"reduced\" or \"not reduced\"")
    end
    time = [i * dwell for i in 0:(npoints-1)]       # times at which acquisition was done
    
    spectr = fft_fid(fid, nB1, noffs, npoints)
    projection = get_projection(spectr, nB1, noffs)

    return spectr, fid, projection, time
end


"time (ut) of pulse are changed, so that first and last digit are weighted only half\n
outpu: time"
function change_average(npoints, dwell)
    time = Float64[]
    append!(time, 0.0)
    append!(time, dwell/2)
    for dig in 1:npoints-2
        append!(time, dwell*dig)
    end
    return time
end


"figure of merit xi is determined for a given projection \n
thresh: threshold in percent, bandwidth is where decoupled signal exceeds the threshold of its maximum intensity (e.g. 80%) \n
according to JMR A, 115, 273-276 (1995)\n
offs above thresh: index of offset which corresponds to a positive offset\n
negative offs above thresh: index of offset which corresponds to a negative offset\n
output: xi, bandwidth, offs_above_thresh, negative_offs_above_thresh"
function determine_xi(thresh, rfav, projection, offs)

    reached = false
    reached_neg = false
    offs_above_thresh, negative_offs_above_thresh = 0, 0
    max_proj = maximum(projection)
    
    for point in 1:ceil(Int32, length(offs)/2)
        if reached == false && (projection[point+ceil(Int32, length(offs)/2)-1] < thresh/100*max_proj)
            offs_above_thresh = point+ceil(Int32, length(offs)/2)-1
            reached = true
        end
        if reached_neg == false && (projection[ceil(Int32, length(offs)/2)+1-point] < thresh/100*max_proj)
            negative_offs_above_thresh = ceil(Int32, length(offs)/2)-point + 2
            reached_neg = true
        end
    end

    bandwidth = offs[offs_above_thresh] + abs(offs[negative_offs_above_thresh])
    xi = bandwidth/rfav
    println("bandwidth = ", bandwidth, " Hz")
    println("xi = ", xi)

    return xi, bandwidth, offs_above_thresh, negative_offs_above_thresh
end


"calculate average of pulse amplitude\n
output: average of rf power"
function get_rf_average(ux, uy, ut)
    ampl = sqrt.(ux.^2 + uy.^2)
    rfav = mean(ampl, weights(ut))
    return rfav
end


"calculate average of pulse amplitude as root mean square value to take rf power into account. Maximum of all powers of the spins is returned\n
output: average of rf power"
# according to JMR A, 115, 273-276 (1995)
function get_rf_average_power(ux, uy, ut, pulsespins)
    rfav_max = 0
    for ispin in pulsespins
        ampl = sqrt.(ux[ispin].^2 + uy[ispin].^2)
        rfav = sqrt.(1/sum(ut[ispin])*sum(ampl.^2 .* ut[ispin]))
        if rfav_max < rfav
            rfav_max = rfav
        end
    end
    println("rfav_max = ", rfav_max, " Hz")
    return rfav_max
end


"calculate average of pulse amplitude as root mean square value, averaged over all bilevel pulses\n
output: average of rf power"
function get_rf_average_power_bilevel(ux, uy, ut, pulsespins, nbilevel)
    rfav = 0
    for ispin in pulsespins
        for ifid in 1:nbilevel
            ampl = sqrt.(ux[ispin][ifid].^2 + uy[ispin][ifid].^2)
            rfav = rfav + sqrt.(1/sum(ut[ispin][ifid])*sum(ampl.^2 .* ut[ispin][ifid])) / nbilevel
        end
    end
    println("rfav = ", rfav, " Hz")
    return rfav
end


"calculate time grid of pulse (absolute time at which each pulse starts)\n
ptgrid: absolute times at which each pulse digits is applied\n
output: ptgrid"
function get_ptgrid(ut)
    # pulse time grid
    ptgrid = zeros(size(ut)[1])
    if ut != []
        ptgrid[1] = ut[1]
        for dig in 2:size(ut)[1]
            ptgrid[dig] = ptgrid[dig-1] + ut[dig]
        end
    end

    return ptgrid
end


"pulses are split up between each dwell times\n
dtgird: absolute times of each dwell time/acquisition point\n
output: acqux, acquy, acquz, acqut, digdwell, dtgrid"
function correct_xyz_to_dwell_changed_average(acqux, acquy, acquz, acqut, npoints, dwell)

    ptgrid = get_ptgrid(acqut)
    digdwell=zeros(npoints+1)     # contains amount of pulse digits per dwell time, pulses in between are seperated into two similar pulses
    facqux = Float64[]          
    facquy = Float64[]          
    facquz = Float64[]          
    facqut = Float64[]           # final time of each pulses used for simulation
    pulse_finished = false
    pcounter = 1                # counting the pulses
    ctime = 0.0
    dtgrid = ones(npoints) .* collect(1:npoints) .* dwell .- dwell*0.5     # dwell time grid
    append!(dtgrid, dwell*npoints)

    # generate digdwell and corrected acqux and acquy
    # facqux, acquy and facqut contain the same pulse parameters, but cut into two at each dwell time
 
    for ipoints=1:npoints+1
        if pulse_finished == false
            digdwell[ipoints] += 1
            while pcounter < size(ptgrid)[1] && ptgrid[pcounter] < dtgrid[ipoints]       # if pulse ends before the time step is ending
                append!(facqux, acqux[pcounter])
                append!(facquy, acquy[pcounter])
                append!(facquz, acquz[pcounter])
                append!(facqut, ptgrid[pcounter]-ctime)
                ctime = ptgrid[pcounter]
                digdwell[ipoints] += 1
                pcounter += 1
            end
            append!(facqux, acqux[pcounter])      # rest of pulse which ends in next time step
            append!(facquy, acquy[pcounter])
            append!(facquz, acquz[pcounter])
            if pcounter == size(acqux)[1]
                append!(facqut, ptgrid[end]-ctime)
            else
                append!(facqut, dtgrid[ipoints]-ctime)
            end
            
            ctime = dtgrid[ipoints]
            if ptgrid[pcounter] == dtgrid[ipoints]     # if pulse ends at the end of the time step
                pcounter += 1
            end
            if pcounter == size(acqux)[1] && ctime >= ptgrid[pcounter]
                pulse_finished = true
            end
        end
    end

    return facqux, facquy, facquz, facqut, digdwell, dtgrid
end


"adiabatic pulse amplitude is doubled and duration is halfed. This pulse is repeated nbilevel-times, then the normal adiabatic pulse is appended, until the end of the aquisition\n
output: acqux, acquy, acquz, acqut"
function adiabatic_to_bilevel(nbilevel, nspins, acqux, acquy, acquz, acqut)

    acquxm, acquym, acquzm, acqutm =  Vector{Vector{Vector{Float64}}}(), Vector{Vector{Vector{Float64}}}(), Vector{Vector{Vector{Float64}}}(), Vector{Vector{Vector{Float64}}}()
    for ispin = 1:nspins
        push!(acquxm, []); push!(acquym, []); push!(acquzm, []); push!(acqutm, [])
    end

    for ispin = 1:nspins
        if !(isempty(acqux[ispin]))
            acquxm[ispin], acquym[ispin], acquzm[ispin], acqutm[ispin] = adiabatic_to_bilevel_one_spin(nbilevel, acqux[ispin], acquy[ispin], acquz[ispin], acqut[ispin])
        end
    end
    return acquxm ,acquym, acquzm, acqutm
end

function adiabatic_to_bilevel_one_spin(nbilevel, acqux, acquy, acquz, acqut)
    acqut_bilevel = acqut ./ 2
    acqux_bilevel = acqux .* 2
    acquy_bilevel = acquy .* 2
    facqux = Vector{Float64}[]
    facquy = Vector{Float64}[]
    facquz = Vector{Float64}[]
    facqut = Vector{Float64}[]

    for lev = 1:nbilevel
        acqux_temp = Float64[]
        acquy_temp = Float64[]
        acquz_temp = Float64[]
        acqut_temp = Float64[]
        ilev = 0
        while ilev < lev-1
            append!(acqux_temp, acqux_bilevel)
            append!(acquy_temp, acquy_bilevel)
            append!(acquz_temp, acquz)
            append!(acqut_temp, acqut_bilevel)
            ilev += 1
        end

        acqux_lev, acquy_lev, acquz_lev, acqut_lev = repeat_pulse_adiabatic_bilevel(acqux, acquy, acquz, acqut, acqux_temp, acquy_temp, acquz_temp, acqut_temp, npoints, dwell)

        push!(facqux, acqux_lev)
        push!(facquy, acquy_lev)
        push!(facquz, acquz_lev)
        push!(facqut, acqut_lev)
    end
    return facqux, facquy, facquz, facqut

end


"calculate offset, symmetric around 0 Hz with width and noffs\n
output: offs"
function get_offset(noffs, width)
    if noffs == 1
        offs = [0]
    else
        offs = [(-width/2+(ioffs-1)*width/(noffs-1)) for ioffs = 1:noffs]
    end
    return offs
end


"calculate offset, asymmetrically from left to right\n
output: offs"
function get_offset_asymm(left, right, noffs)
    if noffs == 1
        offs = [(left+right)/2]
    else
        offs = [(left+(ioffs-1)*(right-left)/(noffs-1)) for ioffs = 1:noffs]
    end
    return offs
end


"calculate B1 symmetrically varying from -theta to +theta
B1: factor which has to multiplied with the rf-amplitude\n
output: fB1"
function get_B1(nB1, theta)
    if nB1 == 1
        fB1 = 1
    else
        fB1 = [1+(-theta/100 + 2*theta*(iB1-1)/((nB1-1)*100)) for iB1 = 1:nB1]        # change of amplitude of B1 field, taking inhomogeneity into account
    end
    return fB1
end


"calculate how the magnetization is changed during a pulse, always starting with z magnetization\n
output: Mx, My, Mz"
function magnetization(ux, uy, ut, nB1, noffs, fB1, offs)
  
    rhoinit = [0.0,0.0,1.0]
    ampl, phase = xy_to_ampl_phase(ux, uy)
    ndigits = size(ampl)[1] #Anzahl an Inkrementen

    #array definitions
    anglex = zeros(ndigits)
    angley = zeros(ndigits)
    Mx = zeros(nB1,noffs)
    My = zeros(nB1,noffs)
    Mz = zeros(nB1,noffs)
    roteff = Matrix(I,3,3)

    #simulate offset dependence of pulse/pulse sequence
    for ip in eachindex(ampl)
        phasesin, phasecos = sincosd(phase[ip])
        anglex[ip] = 2*pi*ampl[ip]*phasecos*ut[ip]
        angley[ip] = 2*pi*ampl[ip]*phasesin*ut[ip]
    end

    for iB1 = 1:nB1
        for ioffs = 1:noffs
            rho = rhoinit
            roteff = Matrix(I,3,3)
            for ip in eachindex(ampl)
                wx = fB1[iB1]*anglex[ip]
                wy = fB1[iB1]*angley[ip]
                wz = -2*pi*offs[ioffs]*ut[ip]
                rot = RotationVec(wx,wy,wz)
                roteff = Matrix(rot) * Matrix(roteff)
            end
            rho = roteff * rho
            Mx[iB1,ioffs] = rho[1]
            My[iB1,ioffs] = rho[2]
            Mz[iB1,ioffs] = rho[3]
        end
    end
    return Mx, My, Mz
end


